ID='SendDirectMessage testing'
code_counter = 0
def code(mainText, choice=0):
    global code_counter
    if choice == 1:
        code_counter += 1
    else:
        code_counter = 0
    if code_counter == 2:
        print("\n\n")
        print("TOKEN INVALID")
        print("\n\n")
        return
    og_mainText = mainText
    error = True
    while error:
        if GetSetting("autoRunCode") != "True":
            exec(ent3.get("1.0", tk.END), globals())
        mainText = og_mainText
        final = ""
        error = False
        if GetSetting("autoRunCode") != "True":
            text = ent3.get("1.0", tk.END) + mainText
        else:
            text = mainText
        text = text.split("\n")
        try:
            if text[-1] == "":
                del(text[-1])
            if text[0] == "":
                del(text[0])
            if text[1] == "":
                del(text[1])
        except:
            pass
        text = "\n".join(text)
        open(_file_+"/Saved_Code", "w").write(text)
        mainLines = mainText.split("\n")
        z = 0
        y = 0
        for line in mainLines:
            y += 1
        for i in range(y):
            line = mainLines[z]
            thru = True
            if line.startswith(">"):
                del(mainLines[z])
            elif line.startswith("TOKEN"):
                line = line.replace(" ", "")
                line = line.replace('''"''', "")
                line = line.replace("'", "")
                line = line.split("=")
                final += line[0] + " = '" + line[1] + "'" + "\n"
                del(mainLines[z])
            else:
                line = line[:line.find("(")]
                line = line.replace("bot", "clientCommands")
                line = line.replace("    ", "")
                line = line.replace("\t", "")
                exec("line2 = None", globals())
                if "clientCommands." in line:
                    try:
                        exec("line2 = (inspect.iscoroutinefunction(" + line + "))", globals())
                    except SyntaxError:
                        exec("line2 = False", globals())
                else:
                    exec("line2 = False", globals())
                mainLines[z] = mainLines[z].replace("    ", "\t")
                indents = 0
                for word in mainLines[z]:
                    if word == "\t":
                        indents += 1
                mainLines[z] = mainLines[z].replace("\t", "")
                if line == "":
                    del(mainLines[z])
                else:
                    if line2 == True:
                        mainLines[z] = "    await " + mainLines[z]
                        thru = False
                    if line2 == False:
                        mainLines[z] = "    " + mainLines[z]
                        thru = False
                    if thru == True:
                        mainLines[z] = "    " + mainLines[z]
                    for i in range(indents):
                        mainLines[z] = "\t" + mainLines[z]
                    z += 1
        #del(mainLines[-1])
        if GetSetting("REPL") == "True":
            keep_alive()
        mainText = "\n".join(mainLines)
        try:
            if choice == 0:
                print("Starting...")
                if not GetSetting("fullscript") == "True":
                    final += '''print(TOKEN)\nbot = clientCommands(createBot(TOKEN, bot=False))\n@bot.client.event\nasync def on_ready():\n    bot.prep()\n'''+mainText+'''\nrun()'''
                else:
                    final = og_mainText
                print(final)
                print("-------------------------")
                exec(final, globals())
                print("\n")
                break
            if choice == 1:
                print("Starting...")
                print("\nERROR: HTTPException")
                print("--Trying Bot Mode--")
                if not GetSetting("fullscript") == "True":
                    final += '''bot = clientCommands(createBot(TOKEN, bot=True))\n@bot.client.event\nasync def on_ready():\n    bot.prep()\n'''+mainText+'''\nrun()'''
                else:
                    final = og_mainText
                print(final)
                print("-------------------------")
                exec(final, globals())
                print("\n")
                break
            if choice == 2:
                final += '''bot = clientCommands(createBot(TOKEN, bot=True))\n@bot.client.event\nasync def on_ready():\n    bot.prep()\n'''+mainText+'''\nrun()'''
                return final
                break
            if choice == 3:
                print("Starting...")
                final = og_mainText
                print(final)
                print("-------------------------")
                exec(final, globals())
                break
        except Exception as e:
            if str(e) != "This event loop is already running":
                print("\n\n")
                print(str(e))
                print("\n\n")
